const Card = (props) => {
  const {name, image, id, plataforms, genero} = props;

  return (
    <>
      <div class="container" key={id}>
        <main class="wrapper">
          <img class="banner-image" src={image} alt={name} />
          <h1>{name}</h1>
          {
            plataforms?.map(elem => {
              return (
                <h3>{elem}</h3>
              )
            })
          }
          {
            genero?.map(genre => {
              return (
                <h4>{genre}</h4>
              )
            })
          }
        </main>
        <footer class="button-wrapper">
          <button class="btn outline">DETAILS</button>
          <button class="btn fill">DELETE</button>
        </footer>
      </div>
    </>
  );
};

export default Card;
